webpackJsonp([0xf2759949f990],{483:function(e,t){e.exports={data:{markdownRemark:{html:'<p>Welcome! You\'ve come to the right place to learn more about using HackerOne.</p>\n<p>Have you just started hacking on HackerOne or want to learn more about a feature? These guides will help you to understand the product so that you can easily navigate through the platform in submitting vulnerabilities.</p>\n<h3>Suggesting Edits for Articles</h3>\n<p>Each article has an <code>Edit this page on GitHub</code> link at the bottom that enables you to put in suggestions for edits to articles.</p>\n<p>To suggest edits:</p>\n<ol>\n<li>Create a GitHub account if you don\'t have one.</li>\n<li>Click the <code>Edit this page on GitHub</code> link to the article you want to suggest edits for.</li>\n<li>You\'ll be redirected to the article in Github where you can edit the text in Markdown.</li>\n<li>Click on the pencil icon in GitHub and put in your edits.\n<img src="https://github.com/Hacker0x01/docs.hackerone.com/blob/master/docs/programs/images/welcome-1.png?raw=true" alt="welcome-1"></li>\n<li><em>(Optional)</em> Summarize your changes in the <strong>Propose file change</strong> section.</li>\n<li>Click <strong>Propose file change</strong>.\n<img src="https://github.com/Hacker0x01/docs.hackerone.com/blob/master/docs/programs/images/welcome-2.png?raw=true" alt="welcome-2"></li>\n</ol>\n<p>Your edits and suggestions will be submitted as a pull request in which documentation administrators can accept or reject your changes.</p>',frontmatter:{path:"/hackers.html",id:"hackers/welcome-to-h1-docs",title:"Welcome to h1 Docs",bookIndexFor:"hackers"}}},pathContext:{}}}});
